import "./styles.css";
import Breadcrumb from '../../../../layout/breadcrumb';
import { Col, Container, Row, Card, CardHeader, CardBody } from 'reactstrap';

const CashoutAvailiableBalanceHelper = (props) => {
    return (
        <Fragment>
            <Breadcrumb parent="Cashout Availiable Account Balance!" title="Cashout Your Available Fund/Funding To A Linked Account.." />
            <Container fluid={true}>
                <Row>
                    <Col sm="12" md="12" lg="12" xl="12">
                        <Card className={"shadow"}>
                            <CardHeader className={"b-r-secondary b-l-secondary"}>
                                <h3>Manage your active payout/cashout methods, add a new payout method, process a "cash-out" & much more!</h3>
                            </CardHeader>
                            <CardBody>
                                <Col sm="12" md="6" lg="6" xl="6">
                                    <Card className="card-absolute">
                                        <CardHeader className="bg-primary">
                                            <h5>Manage Your Payout/Cashout Method's</h5>
                                        </CardHeader>
                                        <CardBody>
                                            <p>
                                                {"Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been"}
                                                {"the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley"}
                                                {"of type and scrambled. Lorem Ipsum is simply dummy text of the printing and typesetting"}
                                                {"industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an"}
                                                {"unknown printer took a galley of type and scrambled."}
                                            </p>
                                        </CardBody>
                                    </Card>
                                </Col> 
                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
}

export default CashoutAvailiableBalanceHelper;
